import profileImg from './img/Profile.png'

export default function About () {
    const fs = require('fs');

fs.readFile('/Users/joe/test.txt', 'utf8', (err, data) => {
  if (err) {
    console.error(err);
    return;
  }
  console.log(data);
});
    let profile = {
        img: profileImg,
        description: ''
    }
    return (
        <div className="about">
            <img className="profile-img" src={profile.img} alt="Profile"/>
            <p>
                {profile.description}
            </p>
        </div>
    )
}
